@use '../abstract/variables' as v;
*{
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

body{
    margin: 0;
    padding: 0;
    background: v.$dark;
    font-family: v.$sans-serif-alt;
    overflow-x: hidden;
    color: v.$white;
}

h1,h2,h3,h4,h5,h6,p,a,span,ul,li{
    text-decoration: none;
    list-style: none;
    letter-spacing: 0.6px;
}

p{
    font-size: v.$fs-6;
    line-height: 28px;
    color: v.$white;
    letter-spacing: 0.6px;
}

a{
    color: v.$primary;
}

img, video{
    width: 100%;
}

.section{
    padding: 50px 0;
}

@media (min-width : v.$lg-breakpoint) {
    .container{
        width: 100%;
        padding: 0 100px;
    }

    .container-fluid{
        width: 100%;
        padding: 0 v.$value4;
    }
}

@media (max-width : v.$lg-breakpoint) {
    .container{
        width: 100%;
        padding: 0 50px;
    }

    .container-fluid{
        width: 100%;
        padding: 0 v.$value3;
    }
}

@media (max-width : v.$md-breakpoint) {
    .container{
        width: 100%;
        padding: 0 30px;
    }

    .container-fluid{
        width: 100%;
        padding: 0 v.$value2;
    }
}

@import url(https://fonts.googleapis.com/css?family=Open+Sans);

.outter {
  position: absolute; 
//   top: 50%;
//   left: 50%;
/*   transform: translateX(-50%);
  transform: translateY(-50%); */
  width: 80px;
  height: 80px;
  border-radius: 80px 0 0 80px;
  border-left: solid 5px v.$primary ;
  animation-name:             spin; 
  animation-duration:         1s; 
  animation-iteration-count:  infinite;
  animation-timing-function:  linear;
}

.mid {
  top: 15px;
  left: 15px; 
  position: relative; 
  width: 50px;
  height: 50px;
  border-radius: 50px 0 0 50px;
  border-left: solid 5px v.$primary-alt; 
  animation-name:             spin 3s infinite linear; 
//   animation-duration:         3s; 
//   animation-iteration-count:  infinite;
//   animation-timing-function:  linear;
}

@keyframes spin {
  from { transform:rotate(0deg) } 
  to { transform:rotate(360deg) } 
}
// @-moz-keyframes spin {
//   from { transform:rotate(0deg) } 
//   to { transform:rotate(360deg) }   
