// to { transform:rotate(360deg) }   
// }

.loader{
    position: fixed;
    display: flex;
    justify-content: center;
    align-items: center;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    z-index: 1000;
    background: v.$dark;
}

