                position: relative;
                left: 0;
                border-left: 5px solid v.$dark;
                color: v.$white;
                font-size: v.$fs-6;
                font-weight: 500;
                border-radius: 2px 20px;
                background: v.$dark;
                transition: 0.5s all ease;

                span{
                    position: absolute;
                    left: 70px;
                    width: 170px;
                }

                &:hover{
                    border-left: 5px solid v.$white;
                    background: v.$primary;
                }

                &.active{
                    border-left: 5px solid v.$white;
                    background: v.$primary;
                }


            }

            &.side-dropdown{
                position: relative;

                a{
                    display: block;
                    padding-bottom: 15px;

                    span .dropdown{
                        position: absolute;
                        right: 0;
                        padding-top: 5px;
                        transition: 0.3s ease;

                        &.rotate{
                            transform: rotate(90deg);
                        }
                    }
                }

                .side-drop{
                    // padding: v.$value1+5px 0;
                    background: v.$dark-alt;
                    border-radius: 2px 20px;
                    display: none;
                    
                    li{
                        list-style: circle;
                        padding: 10px 0 5px 0;
                        padding-left: 70px;
                        color: v.$light;
                        border-radius: 2px 20px;
                        transition: 0.6s all ease;
                        border-left: 5px solid v.$dark-alt;
                        
