                            border-left: 5px solid v.$light;
                            }

                        &.active{
                            background: #183561cb;
                            border-left: 5px solid v.$light;
                            }

                        .sdrop-item{
                            display: block;
                            color: v.$white;
                        }
                    }
                }
            }
        }
    }
