@use '../abstract/variables' as v;
@use '../abstract/mixins' as m;

.table-responsive {
    overflow-x: auto;

    .table{
        // --bs-table-color: var(--bs-body-color);
        // --bs-table-bg: transparent;
        // --bs-table-border-color: var(--bs-border-color);
        // --bs-table-accent-bg: transparent;
        // --bs-table-striped-color: var(--bs-body-color);
        // --bs-table-striped-bg: rgba(0, 0, 0, 0.05);
        // --bs-table-active-color: var(--bs-body-color);
        // --bs-table-active-bg: rgba(0, 0, 0, 0.1);
        // --bs-table-hover-color: var(--bs-body-color);
        // --bs-table-hover-bg: rgba(0, 0, 0, 0.075);
        caption-side: bottom;
        border-collapse: collapse;
        width: 100%;
        margin-bottom: 1rem;
        margin-top: 1rem;
        color: v.$white;
        vertical-align: top;
        border-color: v.$primary-alt;
        transition: 0.5s all ease;
        @include m.tableborder;
    
        thead{
            // border-bottom: 1px solid #1c1f25;

                th{
                    text-align: start;
                    padding: v.$value1 v.$value2;
                    text-transform: uppercase;
                    font-weight: 600;
                    letter-spacing: 1px;
                    font-size: v.$fs-6;
                }
        }
        tbody{
            
            tr{
                border-top: 1px solid #1c1f25;
            }

            td{
                padding: v.$value1 v.$value2;
                font-weight: 400;
            }
        }

        &.table-bordered{
            thead, th, tr, td{
                @include m.tableborder;
            }
        }

        &.table-striped{
            tbody tr:nth-child(odd){
                background: #1c1f25;
            }
        }
        &.table-hover{
            tbody tr:hover{
                background: #1c1f25;
            }
        }
    }
}


.product-table{

    tbody{
        tr{
            td:nth-child(4){
                @include m.d-flex(center, none, nowrap);
                gap: 8px;
            }
        }
    }
    $colors : v.$primary v.$success v.$danger v.$info v.$warning v.$danger-alt;
    
    @for $i from 1 through 6{
        tbody tr:nth-child(#{$i}){
            td:nth-child(3){
                color: nth($colors, $i);
            }
        }
    }
}

