@use '../abstract/variables' as v;
@use '../abstract/mixins' as m;

.dashboard{
    display: flex;
    position: relative;
    width: 100%;
}

.db-body{
    position: relative;
    top: 70px;
    left: 250px;
    transition: 0.6s all ease;
    width: calc(100% - (v.$value10 + v.$value10 + v.$value5));
    min-height: calc(100vh - 120px);

    .db-content{
    position: relative;
    z-index: 0;
    background: v.$dark;
    min-height: calc(100vh - 120px);

    .map{
        iframe{
            width: 100%;
            border: 0;
            height: 307px;
        }
    }

    .img-c{
        img{
            height: 42px;
            border-radius: 4px;
        }
    }
    
    .video-card{
        position: relative;
        overflow: hidden;
        transition: 0.5s all ease;
        height: 155px;
    
        .video-popup{
            transition: 0.5s all ease;
    
            &::after{
                content: " ";
                background: #29273c7a;
                height: 100%;
                width: 100%;
                position: absolute;
                top: 0;
                left: 0;
            }
        }
        
        &:hover{
            transform: scale(1.04);
        }
    
        .img-div{
            width: 40px;
            position: absolute;
            z-index: 5;
            top: 50%;
            left: 50%;
            overflow: hidden;
            transform: translateX(-50%);
            transform: translateY(-50%);
        }
    }

    
}

@media (min-height: v.$lg-breakpoint) {
    
}


}

// Daily Details Card 

.daily-d{

    .card-body{
        @include m.d-flex(center, space-between, nowrap);
    }

    h5{
        font-weight: 500;
        font-size: v.$fs-6;
    }

    h2{
        font-size: v.$fs-3;
        font-weight: 600;
        margin: 5px 0;
    }

    .text-muted{
        font-size: 12px;
    }

    .icons{
        height: 40px;
        width: 40px;
        line-height: 40px;
        font-size: 22px;
        border-radius: 6px;
        text-align: center;

        &.war{
            background: v.$warning;
        }
