@use '../abstract/variables' as v;
@use '../abstract/mixins' as m;

.time-row{
    position: relative;
    z-index: 1;

    .card-title{
        font-size: 18px;
    }

    p{
        font-size: 14px;
        font-weight: 300;
    }

    a img{
        border-radius: 6px;
        border: 1px solid v.$secondary-alt;
    }

    &::before{
        content: " ";
        background: rgb(233 241 253);
        height: 25px;
        width: 25px;
        transform: rotate(45deg);
        position: absolute;
        bottom: -12px;
        left: 24px;
        z-index: -1;
    }
}

